import React from "react";
import { navLink } from "react-router-dom";
export default function Pokemon({ name, img, types }) {
  console.log("ENTRE A POKEMON");

  return (
    <navLink to='/pokemons/'>
      <div>
        <div className="card">
          <h1>{name}</h1>
          <img src={img} alt="" />
          <p>{"Tipos: " + types.join(", ")}</p>
        </div>
      </div>
    </navLink>
  );
}
